Note to Reader If you find an issue with this repository or have a question please feel free to open an issue. I&rsquo;ve included templates for the following issues:
üêû Spelling and Grammar ü§∑ Clarity ‚ùì Question üöÄ Enhancement What&rsquo;s in This Repository? Project plan The project plan ./documents/plan/project_plan.md is the primary planning document for the project.
Risk Management Plan The risk management plan ./documents/risk/risk_management_plan.md is gives an overview of things that can go wrong in a project and how to handle things when they do go wrong.
Project Schedule The project schedule ./documents/schedule/schedule.md gives a list of all tasks involved with project competition.
Course Design Documents The course design ./course_planning/course_design.md contains the overall course goals as well as per week outlines of the course content.
Example Project Plan The contents of ./example are a sample example plan created for a hypothetical birdhouse building project.
[!NOTE] This example plan is not perfect. You should think about this example as a step below a &ldquo;minimum&rdquo; quality for a project plan. Content written here should serve to inform the essence of what should go in each section.
