ewcommand{ kt}[1]{\LA \img{#1}\RA} equire{color}$ Rational Tangles A rational tangle is given by alternating NE,SE and SE,SW twisting of the $0$ tangle${}^{[2]}$${}^{[1]}$. Discussion of canonicality of this construction of twist vector can be found in ${}^{[2]}$. A twist vector encodes these alternating twists as a list of integers. This induces a unique map from the rational tangles onto the rational numbers${}^{[2]}$. We accomplish this by interpreting a twist vector as a sequence for a continued fraction as: $$\LB a\ b\ c\RB=c+ rac{1}{b+ rac{1}{a}}$$
Instructions Twist vectors here are space separated lists of integers.
A rational number here is &ldquo;/&rdquo; separating two integers.
Twist Vector: Rational Number: Sources Conway, J.H. &ldquo;An Enumeration of Knots and Links, and Some of Their Algebraic Properties.&rdquo; In Computational Problems in Abstract Algebra, 329-58. Elsevier, 1970. https://doi.org/10.1016/B978-0-08-012975-4.50034-5. J.R. Goldman, L.H. Kauffman, Rational Tangles, Advances in Applied Math., 18 (1997), 300-332.

