Linearization of Arborescent tangles &#953;&lt;1(2[3][-3])((&lt;2([3][4])[8]([2]1[2])&gt;-2)2)&gt; &#953; $\pm$ Abbreviated Canonical Tangle Trees Weight Condition At each vertex of $\Gamma$, at most one weight is non-zero. Stick Condition On any stick the weights are non-zero except for end vertices that have a bond free in $\Gamma_0$ and for the case $\Gamma_0=\alpha(0[0])$, $\Gamma_0=\alpha[0]$. The non-zero weights along any stick are of alternating sign. No end vertex of a stick has weight $\pm 1$ unless it has a bond free in $\Gamma_0$, or $\Gamma_0=[\pm 1]$. One of: Positivity Condition There are no sticks in $\Gamma_0$ of the form $[-1],\ [ -2],\ \alpha[-2],\ \alpha[2]\alpha$. Negative Condition There are no sticks in $\Gamma_0$ of the form $[1],\ [ 2],\ \alpha[2],\ \alpha[2]\alpha$ Abbreviation Condition A vertex of $\Gamma_0$ of ring number $1$ has valence $\geq 2$, and $\Gamma_0$ is not $\alpha\langle 2\ 0angle$. Every ring subtree of $\Gamma$ is adjacent to a non-essential vertex. F. Bonahon and L. Siebenmann, New geometric splittings of classical knots, and the classification and symmetries of arborescent knots, http://www-bcf.usc.edu/~fbonahon/Research/Publications.html
Theorem (Bonahon and Siebenmann) Consider two $\pm$ canonical abbreviated arborescent tangle trees $\Gamma$ and $\Gamma^\prime$. Plumbing according to $\Gamma$ and $\Gamma^\prime$ gives isomorphic arborescent tangles if and only if $\Gamma$ and $\Gamma^\prime$ can be deduced from each other by a sequence of moves in the calculus of arborescent tangle trees (happy to talk about the calculus another time). Note Note $\pm$ abbreviated canonical tangle trees do not describe minimal diagrams. F. Bonahon and L. Siebenmann, New geometric splittings of classical knots, and the classification and symmetries of arborescent knots, http://www-bcf.usc.edu/~fbonahon/Research/Publications.html
