Existence Existence can be shown by an algorithm to construct a Seifert surface from a given link projection.
Remove crossings Close curves Collection of disks Attaching bands &lt;img class=&quot;centerImg&quot; style=&quot; max-width:500px; &quot; src=&quot; /presentations/Alex_Poly/alg/Alg_4.svg&quot;/&gt; &lt;img class=&quot;centerImg&quot; style=&quot; max-width:500px; &quot; src=&quot; /presentations/Alex_Poly/alg/Alg_5.svg&quot;/&gt; Construction Remove crossings. Connect strands following orientation without creating new crossings. Fill interior of resulting disks. Connect disks with &ldquo;twists&rdquo; matching crossing orientation. SeifertView of $6_{2}$ Bands &lt;img class=&quot;centerImg&quot; style=&quot; max-width:500px; &quot; src=&quot; /presentations/Alex_Poly/alg/Alg_7.svg&quot;/&gt; &lt;p&gt;$$	o$$&lt;/p&gt; &lt;img class=&quot;centerImg&quot; style=&quot; max-width:500px; &quot; src=&quot; /presentations/Alex_Poly/bands/Band.svg&quot;/&gt; Genus of a Seifert surface We have then that as an abstract surface, a Seifert surface for a link is a disc with a number of &ldquo;handles&rdquo;
